import logo from './logo.svg';
import './App.css';
import ResponsiveAppBar from './appbar.jsx';
import Homepage from './homepage.jsx';
import Firstcomp from './firstcomp.jsx';
import Secondcomp from './secondcomp.jsx';
import Footer from './footer.jsx';
import { AppBar } from '@mui/material';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Homepage.jsx />} />
        <Route exact path='/about' element={<Firstcomp.jsx />} />
        <Route exact path='/booking' element={<Secondcomp.jsx />} />
        <Route exact path='/services' element={<Footer.jsx />} />
      </Routes>


    </div>
  );
}

export default App;
